import React, {useState} from 'react';

import { Text, View, Image } from 'react-native';

function KatsItem ({preview, cat, id}) {



	return (
	<View style={{
	        backgroundColor: 'rgba(232, 236, 241, 0.5)',
	      }}>>
		<View key={id} style={{
			height: 'auto',
	        justifyContent: 'center',
	        alignItems: 'center',
	        padding: 15,
	      }}>
			<Image
          	source={{
            width: 200,
            height: 200,
            uri: preview
        }}
          />
          <Text>
          {console.log(cat.map(name => name))}	
          </Text>	         
		</View>
	</View>	
	)
}

export default KatsItem;
